import React,{Component} from 'react'
import Img1 from 'Photos/GoodFork1.jpeg'
import Img2 from 'Photos/GoodFork2.jpg'

class Home extends Component{
    render(){

        const photos = [
            {photo:Photo1,
             text:"Interior of The Good Fork"
            },
            {photo:Photo2,
             text:"Heuvos Rancherritos"
            },
        ]

        return(
            <div>

                {photos.map((e,i) =>
                        <Image src={e.photo}
                        key={i}
                        />
                    )}

            </div>
        )
    }
}
